ГОД ВЫПУСКА: 1995.

СТРАНА ПРОИЗВОДИТЕЛЯ: Украина;

ПРОБЕГ: 20 лет.

РЕГИСТРАЦИЯ: Мартинівкаа;

ВЫСОТА: 188 см;

ФАРЫ: Блядские, проницательные, завораживающие...

КУЗОВ: Не битый, не ржавый, не крашеный, антикор;

ТИП ТОПЛИВА: Сок Добрый)

РАСХОД ТОПЛИВА: Максимальный;

РЕЗИНА: Шипованная.
На крутых поворотах иногда заносит;

КРЫША: На месте, без присмотра подвержена лёгкой деформации;

РУЛЬ: Лёгкий, но при неаккуратном обращении
может клинить и отказывать в управлении вовсе;

САЛОН: Люксовая кожа;

ЗАВОДИТСЯ: С полуоборота, без проблем даже утром и в мороз;

ВЫГЛЯДИТ: Аккуратненько, все приборы и агрегаты
функционируют превосходно;

ЭКСПЛУАТАЦИЯ: Бережная;

КОЛИЧЕСТВО ПРЕДЫДУЩИХ ВЛАДЕЛЬЦЕВ: Не установлено;

ДОКУМЕНТЫ: На руках;

ТЕСТ ДРАЙВ: Обговаривается заранее;

Находится в добрых женских руках))))
